pragma solidity 0.8.4;

import '@openzeppelin/contracts/utils/Strings.sol';

import '../libraries/Colors.sol';
import '../../libraries/Uint.sol';

import './Iterator.sol';
import './Constants.sol';

import '../interfaces/IDotNugg.sol';

/**
 * @dev  calculation.
 */
library Calculator {
    using Iterator for IDotNugg.OrderedGroups;
    using Iterator for IDotNugg.SimpleOrderedGroups;

    using Uint256 for uint256;
    using Uint8 for uint8;

    function _formatForBase(IDotNugg.Attribute memory attr, IDotNugg.Base memory base)
        internal
        pure
        returns (IDotNugg.Combinable memory res, IDotNugg.Base memory)
    {
        res.display.colors = attr.display.colors;
        if (_expanderLen(attr, base) > 0) {
            attr = _addHorizontalExpanders(attr, base);
        }

        if (_verticalExpanderLen(attr, base) > 0) {
            attr = _addVerticalExpanders(attr, base);
        }

        IDotNugg.Coordinate memory baseAnchor = base.baseFeatures[attr.feature.id].anchor;

        IDotNugg.Coordinate memory offset = IDotNugg.Coordinate({x: baseAnchor.x - attr.anchor.x, y: baseAnchor.y - attr.anchor.y});

        if (attr.baseFeature.exists) {
            attr.baseFeature.anchor = IDotNugg.Coordinate({x: offset.x + attr.baseFeature.anchor.x, y: offset.y + attr.baseFeature.anchor.y});
            base.baseFeatures[attr.feature.id] = attr.baseFeature;
        }

        res.display.len = attr.display.len;
        res.display.groups = attr.display.groups;
        res.offset = offset;
        res.orderedGroups = Iterator._newOrderedGroup(attr.display.groups);

        return (res, base);
    }

    function _expanderLen(IDotNugg.Attribute memory attr, IDotNugg.Base memory) internal pure returns (uint8 res) {
        if (attr.expanders.left.exists) res++;
        if (attr.expanders.left2.exists) res++;

        if (attr.expanders.right.exists) res++;
        if (attr.expanders.right2.exists) res++;
    }

    function _verticalExpanderLen(IDotNugg.Attribute memory attr, IDotNugg.Base memory) internal pure returns (uint8 res) {
        if (attr.expanders.up.exists) res++;

        if (attr.expanders.down.exists) res++;
    }

    function _addHorizontalExpanders(IDotNugg.Attribute memory attr, IDotNugg.Base memory base) internal pure returns (IDotNugg.Attribute memory) {
        int8 expandedL = 0;
        int8 expandedR = 0;

        IDotNugg.Group[] memory createdGroups = new IDotNugg.Group[](attr.display.groups.length);
        IDotNugg.SimpleOrderedGroups memory coGroups = Iterator._newSimpleOrderedGroup(attr.display.groups);

        for (uint16 i = 0; coGroups._isNextS(); i++) {
            coGroups = coGroups._getNextS();
            IDotNugg.Group memory tmp = coGroups._currentGroupS();

            uint8 checkedExp = _checkExpander(tmp.colorID);

            if (checkedExp == 0) {
                createdGroups[i] = tmp;
            } else if (checkedExp == 76) {
                // L
                expandedL = int8(base.baseFeatures[attr.feature.id].arguments.l) - 1;
                tmp.colorID = attr.expanders.left.colorID;
                tmp.len = base.baseFeatures[attr.feature.id].arguments.l;
                createdGroups[i] = tmp;
            } else if (checkedExp == 108) {
                // l
                expandedL = int8(base.baseFeatures[attr.feature.id].arguments.l) - 1;
                tmp.colorID = attr.expanders.left2.colorID;
                tmp.len = base.baseFeatures[attr.feature.id].arguments.l;
                createdGroups[i] = tmp;
            } else if (checkedExp == 82) {
                // R
                expandedR = int8(base.baseFeatures[attr.feature.id].arguments.r) - 1;
                tmp.colorID = attr.expanders.right.colorID;
                tmp.len = base.baseFeatures[attr.feature.id].arguments.r;
                createdGroups[i] = tmp;
            } else if (checkedExp == 114) {
                // r
                expandedR = int8(base.baseFeatures[attr.feature.id].arguments.r) - 1;
                tmp.colorID = attr.expanders.right2.colorID;
                tmp.len = base.baseFeatures[attr.feature.id].arguments.r;
                createdGroups[i] = tmp;
            } else {
                require(false, '_addHorizontalExpanders: should not happen (1) ');
            }
        }
        attr.display.groups = createdGroups;
        attr.display.len.x = uint8(int8(attr.display.len.x) + expandedL + expandedR);
        attr.anchor.x = uint8(int8(attr.anchor.x) + expandedL);
        return attr;
    }

    function _addVerticalExpanders(IDotNugg.Attribute memory attr, IDotNugg.Base memory base) internal pure returns (IDotNugg.Attribute memory) {
        IDotNugg.Group[] memory createdGroups = new IDotNugg.Group[](
            attr.display.groups.length + base.baseFeatures[attr.feature.id].arguments.u * 32 + base.baseFeatures[attr.feature.id].arguments.d * 32
        );
        IDotNugg.SimpleOrderedGroups memory coGroups = Iterator._newSimpleOrderedGroup(attr.display.groups);

        IDotNugg.VerticalExpanderVars memory v;

        v.indexU = 0;
        v.indexD = 0;

        v.foundU = false;
        v.foundD = false;

        if (attr.expanders.up.id != 0) {
            v.foundU = true;
            v.indexU = attr.expanders.up.row * attr.display.len.x;
        }
        if (attr.expanders.down.id != 0) {
            v.foundD = true;
            v.indexD = attr.expanders.down.row * attr.display.len.x;
        }

        if (!v.foundU && !v.foundD) {
            return attr;
        }

        v.lenU = base.baseFeatures[attr.feature.id].arguments.u;
        v.lenD = base.baseFeatures[attr.feature.id].arguments.d;

        IDotNugg.Group[] memory rowD = new IDotNugg.Group[](32);
        IDotNugg.Group[] memory rowU = new IDotNugg.Group[](32);

        v.rowUCount = 0;
        v.rowDCount = 0;

        v.createdGroupsIndex = 0;

        for (uint16 i = 0; coGroups._isNextS(); i++) {
            if (v.foundU) {
                if (coGroups.cumPasses < v.indexU && coGroups.cumPasses > v.indexU + attr.display.len.x) {
                    rowU[v.rowUCount++] = coGroups._currentGroupS();
                } else if (v.rowUCount > 0) {
                    for (uint8 j = 0; j < v.lenU; j++) {
                        for (uint8 k = 0; k < v.rowUCount; k++) {
                            createdGroups[v.createdGroupsIndex++] = rowU[k];
                        }
                    }
                    v.rowUCount = 0;
                }
            }
            if (v.foundD) {
                if (coGroups.cumPasses < v.indexD && coGroups.cumPasses > v.indexD + attr.display.len.x) {
                    rowD[v.rowDCount++] = coGroups._currentGroupS();
                } else if (v.rowDCount > 0) {
                    for (uint8 j = 0; j < v.lenD; j++) {
                        for (uint8 k = 0; k < v.rowDCount; k++) {
                            createdGroups[v.createdGroupsIndex++] = rowD[k];
                        }
                    }
                    v.rowDCount = 0;
                }
            }
            createdGroups[v.createdGroupsIndex++] = coGroups._currentGroupS();
        }

        if (v.rowUCount > 0) {
            for (uint8 j = 0; j < v.lenU; j++) {
                for (uint8 k = 0; k < v.rowUCount; k++) {
                    createdGroups[v.createdGroupsIndex++] = rowU[k];
                }
            }
            v.rowUCount = 0;
        }
        if (v.rowDCount > 0) {
            for (uint8 j = 0; j < v.lenD; j++) {
                for (uint8 k = 0; k < v.rowDCount; k++) {
                    createdGroups[v.createdGroupsIndex++] = rowD[k];
                }
            }
            v.rowDCount = 0;
        }

        IDotNugg.Group[] memory correctSizedGroupsArray = new IDotNugg.Group[](v.createdGroupsIndex);

        for (uint16 i = 0; i < v.createdGroupsIndex; i++) {
            correctSizedGroupsArray[i] = createdGroups[i];
        }

        attr.display.groups = correctSizedGroupsArray;
        attr.display.len.y = attr.display.len.y + v.lenU + v.lenD;
        attr.anchor.y = attr.anchor.y + v.lenU;

        return attr;
    }

    // returns 0 if false
    function _checkExpander(uint8 id) internal pure returns (uint8) {
        if (id == 82 || id == 114 || id == 76 || id == 108) return id;
        return 0;
    }

    // returns 0 if false
    function _checkVerticalExpander(uint8 id) internal pure returns (uint8) {
        if (id == 85 || id == 68) return id;
        return 0;
    }

    function _combine(IDotNugg.Combinable[] memory combinables, IDotNugg.Base memory base) internal pure returns (IDotNugg.Display memory res) {
        IDotNugg.Combinable memory combinableBase = IDotNugg.Combinable({
            display: base.display,
            orderedGroups: Iterator._newOrderedGroup(base.display.groups),
            offset: IDotNugg.Coordinate({x: 0, y: 0})
        });

        IDotNugg.Color[][] memory matrix = new IDotNugg.Color[][](combinableBase.display.len.y);
        IDotNugg.Color[] memory colorArray = new IDotNugg.Color[](uint16(combinableBase.display.len.y) * uint16(combinableBase.display.len.x));
        uint16 colorIndex = 0;
        colorArray[colorIndex++] = IDotNugg.Color({id: 0, layer: 1, rgba: IDotNugg.RGBA8({r: 69, g: 69, b: 69, a: 0}), exists: true});

        uint16[] memory baseColorMap = new uint16[](257);

        for (uint8 y = 0; y < combinableBase.display.len.y; y++) {
            matrix[y] = new IDotNugg.Color[](combinableBase.display.len.x);
            for (uint8 x = 0; x < combinableBase.display.len.x; x++) {
                if (combinableBase.orderedGroups._isNext() || combinableBase.orderedGroups._len() == 1) {
                    combinableBase.orderedGroups = combinableBase.orderedGroups._getNext();
                    if (combinableBase.orderedGroups._currentGroup().colorID == Constants.TRANSPARENT_COLOR_ID) {
                        matrix[y][x] = colorArray[0];
                    } else {
                        // TODO MAKE SURE THIS COLOR WORKS
                        IDotNugg.Color memory tempColor = combinableBase.display.colors[combinableBase.orderedGroups._currentGroup().colorID];
                        if (baseColorMap[tempColor.id + 1] == 0) {
                            uint16 tempColorIndex = colorIndex++;
                            colorArray[tempColorIndex] = IDotNugg.Color({
                                id: uint8(tempColorIndex),
                                layer: tempColor.layer,
                                rgba: tempColor.rgba,
                                exists: true
                            });
                            baseColorMap[tempColor.id + 1] = tempColorIndex;
                            matrix[y][x] = colorArray[tempColorIndex];
                        } else {
                            matrix[y][x] = IDotNugg.Color({
                                id: uint8(baseColorMap[tempColor.id + 1]),
                                layer: tempColor.layer,
                                rgba: tempColor.rgba,
                                exists: true
                            });
                        }
                    }
                }
            }
        }

        for (uint8 i = 0; i < combinables.length; i++) {
            IDotNugg.Combinable memory combinable = combinables[i];
            uint16[] memory colorMap = new uint16[](257);
            for (uint8 y = combinable.offset.y; y < combinable.display.len.y + combinable.offset.y; y++) {
                for (int8 xInt = int8(combinable.offset.x); xInt < int8(combinable.display.len.x + combinable.offset.x); xInt++) {
                    uint8 x = uint8(xInt);
                    if (combinable.orderedGroups._isNext()) {
                        combinable.orderedGroups = combinable.orderedGroups._getNext();

                        if (combinable.orderedGroups._currentGroup().len == 0) {
                            xInt--;
                            continue;
                        }

                        if (combinable.orderedGroups._currentGroup().colorID == Constants.TRANSPARENT_COLOR_ID) {
                            continue;
                        }
                        require(combinable.orderedGroups._currentGroup().colorID < combinable.display.colors.length, 'color ID out of bounds ');

                        // TODO MAKE SURE THIS COLOR WORKS
                        IDotNugg.Color memory tempColor = combinable.display.colors[combinable.orderedGroups._currentGroup().colorID];

                        if (!tempColor.exists) {
                            continue;
                        }
                        if (tempColor.layer > matrix[y][x].layer) {
                            (IDotNugg.RGBA8 memory tempRGBA, bool modified) = Colors.combine(matrix[y][x].rgba, tempColor.rgba);
                            // ################################
                            // TODO: THIS LINE DISABLES COLOR BLENDING
                            // tempRGBA = tempColor.rgba;
                            // ################################
                            if (modified) {
                                uint16 tempColorIndex = colorIndex++;
                                colorArray[tempColorIndex] = IDotNugg.Color({id: uint8(tempColorIndex), layer: tempColor.layer, rgba: tempRGBA, exists: true});
                                matrix[y][x] = colorArray[tempColorIndex];
                            } else if (colorMap[tempColor.id + 1] == 0) {
                                uint16 tempColorIndex = colorIndex++;
                                colorArray[tempColorIndex] = IDotNugg.Color({id: uint8(tempColorIndex), layer: tempColor.layer, rgba: tempRGBA, exists: true});
                                matrix[y][x] = colorArray[tempColorIndex];
                                colorMap[tempColor.id + 1] = tempColorIndex;
                            } else {
                                matrix[y][x] = IDotNugg.Color({
                                    id: uint8(colorMap[tempColor.id + 1]),
                                    layer: tempColor.layer,
                                    rgba: tempColor.rgba,
                                    exists: true
                                });
                            }
                        }
                    }
                }
            }
        }

        IDotNugg.Group[] memory miniGroups = new IDotNugg.Group[](uint16(base.display.len.x) * uint16(base.display.len.y));
        uint16 miniGroupIndex = 0;
        for (uint16 y = 0; y < base.display.len.y; y++) {
            for (uint16 x = 0; x < base.display.len.x; x++) {
                miniGroups[miniGroupIndex] = IDotNugg.Group({len: 1, colorID: matrix[y][x].id});
                miniGroupIndex++;
            }
        }

        IDotNugg.Color[] memory correctSizedColorArray = new IDotNugg.Color[](colorIndex);

        for (uint16 i = 0; i < colorIndex; i++) {
            correctSizedColorArray[i] = colorArray[i];
        }

        res.colors = correctSizedColorArray;
        res.groups = miniGroups;
        res.len = base.display.len;
    }

    function _newDisplay(IDotNugg.Base memory base, IDotNugg.Attribute[] memory attrs) internal pure returns (IDotNugg.Display memory) {
        IDotNugg.Combinable[] memory combinables = new IDotNugg.Combinable[](attrs.length);

        for (uint16 i = 0; i < attrs.length; i++) {
            (IDotNugg.Combinable memory temp, IDotNugg.Base memory tempBase) = _formatForBase(attrs[i], base);

            combinables[i] = temp;
            base = tempBase;
        }

        return _combine(combinables, base);
    }

    function _compressGroups(IDotNugg.Display memory display) internal pure returns (IDotNugg.Display memory) {
        IDotNugg.Group[] memory res = new IDotNugg.Group[](display.groups.length);
        IDotNugg.OrderedGroups memory iter = Iterator._newOrderedGroup(display.groups);
        uint8 activeCount = 1;
        uint8 activeByte = display.groups[0].colorID;
        uint16 resIndex = 0;
        for (; iter._isNext(); ) {
            iter = iter._getNext();
            if (activeByte == iter._currentGroup().colorID) {
                if (activeCount < type(uint8).max) {
                    activeCount++;
                    continue;
                }
            }
            res[resIndex++] = IDotNugg.Group({len: activeCount, colorID: activeByte});
            activeCount = 1;
            activeByte = iter._currentGroup().colorID;
        }
        res[resIndex++] = IDotNugg.Group({len: activeCount, colorID: activeByte});

        IDotNugg.Group[] memory correctSizedGroupArray = new IDotNugg.Group[](resIndex);

        for (uint16 i = 0; i < resIndex; i++) {
            correctSizedGroupArray[i] = res[i];
        }

        display.groups = correctSizedGroupArray;

        return display;
    }
}
