pragma solidity 0.8.4;

import '../interfaces/IDotNugg.sol';
import '../../libraries/Uint.sol';

import '../libraries/Colors.sol';
import '../interfaces/IDotNugg.sol';

/**
 * @dev DotNugg calculation.
 */
library Iterator {
    function _newOrderedGroup(IDotNugg.Group[] memory groups) internal pure returns (IDotNugg.OrderedGroups memory res) {
        require(groups.length > 0, 'NEWORDEREDGROUPS: group of len 0');
        res.groups = groups;
    }

    function _len(IDotNugg.OrderedGroups memory itr) internal pure returns (uint256 res) {
        if (itr.idx >= itr.groups.length) return 0;
        return itr.groups.length - itr.idx + 1;
    }

    function _isNext(IDotNugg.OrderedGroups memory itr) internal pure returns (bool res) {
        if (itr.idx + 1 < itr.groups.length) {
            res = true;
        } else if (itr.idx + 1 == itr.groups.length) {
            if (itr.passes < _currentGroup(itr).len) {
                return true;
            }
        }
    }

    function _getNext(IDotNugg.OrderedGroups memory itr) internal pure returns (IDotNugg.OrderedGroups memory) {
        if (_isNext(itr)) {
            if (itr.started == 0) {
                itr.idx = 0;
                itr.passes = 1;
                itr.started = 1;
                return itr;
            }

            IDotNugg.Group memory group = _currentGroup(itr);

            if (itr.passes >= group.len) {
                itr.idx++;
                itr.passes = 1;
            } else {
                itr.passes++;
            }
            return itr;
        }
        itr.idx = uint16(itr.groups.length);
        return itr;
    }

    function _currentGroup(IDotNugg.OrderedGroups memory itr) internal pure returns (IDotNugg.Group memory res) {
        require(itr.groups.length > 0, '_currentGroup: group of len 0');
        // if (itr.idx < itr.groups.length) {
        res = itr.groups[itr.idx];
        //     ok = true;
        // }
    }

    function _newSimpleOrderedGroup(IDotNugg.Group[] memory groups) internal pure returns (IDotNugg.SimpleOrderedGroups memory res) {
        require(groups.length > 0, 'NEWSIMPLEORDEREDGROUPS: group of len 0');
        res.groups = groups;
    }

    function _lenS(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (uint256 res) {
        if (itr.idx >= itr.groups.length) return 0;
        return itr.groups.length - itr.idx + 1;
    }

    function _isNextS(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (bool res) {
        if (itr.idx + 1 < itr.groups.length) {
            res = true;
        }
    }

    function _getNextS(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (IDotNugg.SimpleOrderedGroups memory) {
        if (_isNextS(itr)) {
            if (itr.started == 0) {
                itr.cumPasses = 0;
                itr.idx = 0;
                itr.started = 1;
                return itr;
            }
            IDotNugg.Group memory group = _currentGroupS(itr);
            itr.idx++;
            itr.cumPasses += group.len;
            return itr;
        }
        itr.idx = uint16(itr.groups.length);
        return itr;
    }

    function _currentGroupS(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (IDotNugg.Group memory res) {
        require(itr.groups.length > 0, '_currentGroup: group of len 0');
        // if (itr.idx < itr.groups.length) {
        res = itr.groups[itr.idx];
        //     ok = true;
        // }
    }
}
