import '../../libraries/Uint.sol';
import '../interfaces/IDotNugg.sol';

import '../libraries/Colors.sol';
import '../interfaces/IDotNugg.sol';

/**
 * @dev DotNugg calculation.
 */
library IteratorV2 {
    function newOrderedGroup(IDotNugg.Group[] memory groups) internal pure returns (IDotNugg.OrderedGroups memory res) {
        require(groups.length > 0, 'NEWORDEREDGROUPS: group of len 0');
        res.groups = groups;
    }

    function len(IDotNugg.OrderedGroups memory itr) internal pure returns (uint256 res) {
        if (itr.idx >= itr.groups.length) return 0;
        return itr.groups.length - itr.idx + 1;
    }

    function hasNext(IDotNugg.OrderedGroups memory itr) internal pure returns (bool res) {
        if (itr.idx + 1 < itr.groups.length) {
            res = true;
        } else if (itr.idx + 1 == itr.groups.length) {
            if (itr.passes < current(itr).len) {
                res = true;
            }
        }

        if (res) {
            if (itr.started == 0) {
                itr.idx = 0;
                itr.passes = 1;
                itr.started = 1;
                return res;
            }

            IDotNugg.Group memory group = current(itr);

            if (itr.passes >= group.len) {
                itr.idx++;
                itr.passes = 1;
            } else {
                itr.passes++;
            }
            return res;
        }

        itr.idx = uint16(itr.groups.length);
    }

    function current(IDotNugg.OrderedGroups memory itr) internal pure returns (IDotNugg.Group memory res) {
        require(itr.groups.length > 0, 'current: group of len 0');
        res = itr.groups[itr.idx];
    }

    function newSimpleOrderedGroup(IDotNugg.Group[] memory groups) internal pure returns (IDotNugg.SimpleOrderedGroups memory res) {
        require(groups.length > 0, 'NEWSIMPLEORDEREDGROUPS: group of len 0');
        res.groups = groups;
    }

    function len(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (uint256 res) {
        if (itr.idx >= itr.groups.length) return 0;
        return itr.groups.length - itr.idx + 1;
    }

    function hasNext(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (bool res) {
        if (itr.idx + 1 < itr.groups.length) {
            res = true;
        }
        if (res) {
            if (itr.started == 0) {
                itr.cumPasses = 0;
                itr.idx = 0;
                itr.started = 1;
                return res;
            }
            itr.cumPasses += current(itr).len;
            itr.idx++;
            return res;
        }
        itr.idx = uint16(itr.groups.length);
    }

    function current(IDotNugg.SimpleOrderedGroups memory itr) internal pure returns (IDotNugg.Group memory res) {
        require(itr.groups.length > 0, 'current: group of len 0');
        res = itr.groups[itr.idx];
    }
}
