pragma solidity 0.8.4;

import './Bytes.sol';
import '../interfaces/IDotNugg.sol';

library Colors {
    using Bytes for bytes;

    function combine(IDotNugg.RGBA8 memory base, IDotNugg.RGBA8 memory mix) internal pure returns (IDotNugg.RGBA8 memory res, bool) {
        if (mix.a == 255) {
            return (mix, false);
        }

        IDotNugg.RGBA16 memory baseRGB = IDotNugg.RGBA16({r: uint16(base.r), g: uint16(base.g), b: uint16(base.b), a: uint16(base.a)});
        IDotNugg.RGBA16 memory mixRGB = IDotNugg.RGBA16({r: uint16(mix.r), g: uint16(mix.g), b: uint16(mix.b), a: uint16(mix.a)});

        // uint8 alpha = uint8(255 - (((255 - baseRGB.a) * (255 - mixRGB.a)) / 255));
        uint8 red = uint8((baseRGB.r * (255 - mixRGB.a) + mixRGB.r * mixRGB.a) / 255);
        uint8 green = uint8((baseRGB.g * (255 - mixRGB.a) + mixRGB.g * mixRGB.a) / 255);
        uint8 blue = uint8((baseRGB.b * (255 - mixRGB.a) + mixRGB.b * mixRGB.a) / 255);

        return (IDotNugg.RGBA8({r: red, g: green, b: blue, a: 255}), true);
    }

    function toAscii(IDotNugg.RGBA8 memory base) internal pure returns (string memory res) {
        bytes memory input = abi.encodePacked(base.r, base.g, base.b, base.a);
        return input.toAscii();
    }

    function combine(bytes memory base, bytes memory mix) internal pure returns (IDotNugg.RGBA8 memory res, bool) {
        IDotNugg.RGBA8 memory baseRGB = IDotNugg.RGBA8({
            r: base.toUint8(0),
            g: base.toUint8(1),
            b: base.toUint8(2),
            a: base.length > 3 ? base.toUint8(3) : uint8(225)
        });
        IDotNugg.RGBA8 memory mixRGB = IDotNugg.RGBA8({
            r: mix.toUint8(0),
            g: mix.toUint8(1),
            b: mix.toUint8(2),
            a: mix.length > 3 ? mix.toUint8(3) : uint8(225)
        });

        return combine(baseRGB, mixRGB);
    }
}
