pragma solidity 0.8.4;

import '../interfaces/IDotNugg.sol';
import '../base/IteratorV2.sol';
import '../base/Constants.sol';
import '../base/Calculator.sol';

import './Colors.sol';
import '../../libraries/Uint.sol';


/**
 * @dev Bytes1 operations.
 */
library Svg {
    using IteratorV2 for IDotNugg.OrderedGroups;
    using IteratorV2 for IDotNugg.SimpleOrderedGroups;

    using Colors for IDotNugg.RGBA8;
    using Uint256 for uint256;
    using Uint8 for uint8;

    function getSvgRects2(IDotNugg.Display memory display, uint256 pixelWidth) internal pure returns (bytes memory res) {
        IDotNugg.SimpleOrderedGroups memory ittr = IteratorV2.newSimpleOrderedGroup(Calculator._compressGroups(display).groups);

        uint8 x = 0;
        uint8 y = 0;

        while (ittr.hasNext()) {
            // if (ittr.current().colorID == 0) {
            //     continue;
            // }
            if (x == display.len.x) {
                y++;
                x = 0;
            }
            while (ittr.current().len > 0 && ittr.current().len + x >= display.len.x) {
                uint8 remaining = display.len.x - x;
                res = abi.encodePacked(
                    res,
                    getRekt(display.colors[ittr.current().colorID].rgba, x * pixelWidth, y * pixelWidth, pixelWidth, remaining * pixelWidth)
                );
                ittr.current().len -= display.len.x - x;
                y++;
                x = 0;
            }
            if (ittr.current().len == 0) {
                continue;
            }

            uint256 x_offset = x * pixelWidth;
            uint256 y_offset = y * pixelWidth;
            uint256 size = pixelWidth;
            uint256 width = pixelWidth * ittr.current().len;
            res = abi.encodePacked(res, getRekt(display.colors[ittr.current().colorID].rgba, x_offset, y_offset, size, width));

            x += ittr.current().len;
        }
    }

    function getRekt(
        IDotNugg.RGBA8 memory rgba,
        uint256 x,
        uint256 y,
        uint256 xlen,
        uint256 ylen
    ) internal pure returns (bytes memory res) {
        if (rgba.a == 0) return '';
        res = abi.encodePacked(
            "\t<rect fill='#",
            rgba.toAscii(),
            "' x='",
            x.toString(),
            "' y='",
            y.toString(),
            "' height='",
            xlen.toString(),
            "' width='",
            ylen.toString(),
            "'/>\n"
        );
    }

    function toSvg(IDotNugg.Display memory display, uint256 pixelWidth) internal view returns (bytes memory) {
        uint256 svgWidth = display.len.x * pixelWidth;

        bytes memory header = abi.encodePacked(
            "<svg viewBox='0 0 ",
            svgWidth.toString(),
            ' ',
            svgWidth.toString(),
            "' width='",
            svgWidth.toString(),
            "' height='",
            svgWidth.toString(),
            "' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'>\n"
        );

        bytes memory rects = getSvgRects2(display, pixelWidth);

        return abi.encodePacked(header, rects, '</svg>');
    }
}
